CREATE TABLE titles (
	title_id uuid NOT NULL,
	title_name varchar NOT NULL,
	CONSTRAINT titles_pk PRIMARY KEY (title_id)
);


CREATE TABLE positions (
	id uuid NOT NULL,
	employee_id uuid NULL,
	project_id uuid NULL,
	title_id uuid NULL,
	salary numeric(19, 2) NOT NULL,
	CONSTRAINT positions_employee_id_fkey FOREIGN KEY (employee_id) REFERENCES employees(employee_id),
	CONSTRAINT positions_project_id_fkey FOREIGN KEY (project_id) REFERENCES projects(project_id),
	CONSTRAINT positions_title_id_fkey FOREIGN KEY (title_id) REFERENCES titles(title_id)
);

